SET FLUSH ON;
SET SERVEROUTPUT ON;

DECLARE
	v_ExistCount NUMBER := 0;
	v_STAGE NUMBER := 0;
	v_STAGE_TITLE VARCHAR2(50) := '';
BEGIN


	v_STAGE  := 101;
	v_STAGE_TITLE  := 'DESTINATION_TABLE_DELETE_STUDENTMASATER';
	DBMS_OUTPUT.PUT_LINE ('....START...constructing STUDENTMASTER.....');

    SELECT COUNT(*) INTO v_ExistCount FROM user_tables
    WHERE TABLE_NAME = 'STUDENTMASTER';
    
	IF ( v_ExistCount = 1 ) THEN
	EXECUTE IMMEDIATE 'DELETE FROM STUDENTMASTER';
	END IF;	
	

DBMS_OUTPUT.PUT_LINE('-----------------Record Insert Done in STUDENTMASTER  ');
COMMIT;
END;
